import React from "react";
import { Link } from "react-router-dom";

export default function NavBar() {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-scroll fixed-top shadow-0 border-bottom border-dark" style={{ backgroundColor: "#1A1A1A" }}>
        <div class="container">
          <Link class="navbar-brand" to="/">
            Dennis
          </Link>
          <button
            class="navbar-toggler"
            type="button"
            data-mdb-toggle="collapse"
            data-mdb-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <i class="fas fa-bars"></i>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav ms-auto">
              <li class="nav-item">
                <Link class="nav-link text-white fw-bold display-6" to="/me">
                  About Me
                </Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link text-white fw-bold" to="/articles">
                  Articles
                </Link>
              </li>
              {/* <button type="button" class="btn btn-dark ms-3"> */}
                <Link
                  class="nav-link text-white fw-bold btn text-capitalize"
                  to="/hire-me"
                  style={{ fontSize: "20px", backgroundColor: "#007BFF" }}
                >
                  Work With Me
                </Link>
              {/* </button> */}
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
}

